import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { auth, db } from '../firebase';
import { signOut } from 'firebase/auth';
import {
  collection,
  getDocs,
  query,
  where,
  orderBy
} from 'firebase/firestore';

function Dashboard() {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [announcements, setAnnouncements] = useState([]);
  const [applications, setApplications] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [filteredApps, setFilteredApps] = useState([]);
  const [showStatusModal, setShowStatusModal] = useState(false);
  const [submittedApps, setSubmittedApps] = useState([]);

  // Redirect if not logged in
  useEffect(() => {
    const currentUser = auth.currentUser;
    if (currentUser) {
      setUser(currentUser);
    } else {
      navigate('/login');
    }
  }, [navigate]);

  // Fetch announcements
  useEffect(() => {
    const fetchAnnouncements = async () => {
      const q = query(collection(db, 'announcements'), orderBy('startDate', 'desc'));
      const snapshot = await getDocs(q);
      const ann = snapshot.docs.map(doc => doc.data());
      setAnnouncements(ann);
    };
    fetchAnnouncements();
  }, []);

  // Fetch live applications
  useEffect(() => {
    const fetchApplications = async () => {
      const snapshot = await getDocs(collection(db, 'applications'));
      const liveApps = snapshot.docs
        .map(doc => ({ id: doc.id, ...doc.data() }))
        .filter(app => app.status === 'Live');
      setApplications(liveApps);
      setFilteredApps(liveApps);
    };
    fetchApplications();
  }, []);

  const handleSearch = () => {
    const search = searchTerm.toLowerCase();
    const matches = applications.filter(app =>
      app.name.toLowerCase().includes(search)
    );
    setFilteredApps(matches);
  };

  const logout = async () => {
    await signOut(auth);
    alert('Logged out');
    navigate('/login');
  };

  const goToApply = (appId) => {
    navigate('/apply', { state: { user: user.email, applicationId: appId } });
  };

  const goToCheckStatus = (appId) => {
    navigate('/check-status', { state: { user: user.email, applicationId: appId } });
  };

  const fetchSubmittedApplications = async () => {
    try {
      const appliedQuery = query(
        collection(db, 'Applied'),
        where('userId', '==', user.email)
      );
      const appliedSnap = await getDocs(appliedQuery);
      const apps = [];

      for (const doc of appliedSnap.docs) {
        const appliedData = doc.data();
        const appId = doc.id;
        let status = appliedData.verify ? 'Verified' : 'Applied';

        const checkedQuery = query(
          collection(db, 'CheckedApp'),
          where('appliedId', '==', appId)
        );
        const checkedSnap = await getDocs(checkedQuery);
        if (!checkedSnap.empty) {
          status = checkedSnap.docs[0].data().status;
        }

        apps.push({
          name: appliedData.name || 'Unnamed',
          applicationId: appliedData.applicationId,
          status
        });
      }

      setSubmittedApps(apps);
      setShowStatusModal(true);
    } catch (err) {
      console.error('Error fetching status:', err);
      alert('Error fetching submitted applications.');
    }
  };

  const closeModal = () => {
    setShowStatusModal(false);
  };

  if (!user) return <p>Loading...</p>;

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: 'auto' }}>
      <h2>Welcome, {user.email}</h2>

      {/* Search bar */}
      <div style={{ marginBottom: '20px', display: 'flex', gap: '10px' }}>
        <input
          type="text"
          placeholder="Search applications..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={{
            flex: 1,
            padding: '10px',
            border: '1px solid #ccc',
            borderRadius: '5px'
          }}
        />
        <button onClick={handleSearch} style={{ padding: '10px 20px' }}>
          Search
        </button>
      </div>

      {/* Applications List */}
      <h3>Available Applications</h3>
      {filteredApps.length === 0 ? (
        <p>No matching applications found.</p>
      ) : (
        filteredApps.map(app => (
          <div key={app.id} style={{
            background: '#f9f9f9',
            padding: '10px',
            borderRadius: '5px',
            marginBottom: '10px',
            border: '1px solid #ddd'
          }}>
            <p><strong>{app.name}</strong> - {app.category}</p>
            <p>{app.message}</p>
            <div style={{ display: 'flex', gap: '10px', marginTop: '10px' }}>
              <button onClick={() => goToApply(app.id)}>Apply</button>
              <button onClick={() => goToCheckStatus(app.id)}>Check Status</button>
            </div>
          </div>
        ))
      )}

      {/* Announcements */}
      <div style={{ marginTop: '30px' }}>
        <h3>Announcements</h3>
        {announcements.length === 0 ? (
          <p>No announcements available.</p>
        ) : (
          announcements.map((a, idx) => (
            <div key={idx} style={{
              background: '#f0f0f0',
              padding: '10px',
              borderRadius: '5px',
              marginBottom: '10px'
            }}>
              {a.message}
            </div>
          ))
        )}
      </div>

      {/* Bottom buttons */}
      <div style={{ marginTop: '30px', display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
        <button
          onClick={() => navigate('/profile')}
          style={{
            padding: '10px 20px',
            backgroundColor: '#4caf50',
            color: 'white',
            border: 'none',
            borderRadius: '4px'
          }}
        >
          Profile
        </button>

        <button
          onClick={logout}
          style={{
            padding: '10px 20px',
            backgroundColor: '#f44336',
            color: 'white',
            border: 'none',
            borderRadius: '4px'
          }}
        >
          Logout
        </button>

        <button
          onClick={fetchSubmittedApplications}
          style={{
            padding: '10px 20px',
            backgroundColor: '#2196f3',
            color: 'white',
            border: 'none',
            borderRadius: '4px'
          }}
        >
          Check My Applications
        </button>
      </div>

      {/* Modal for submitted applications */}
      {showStatusModal && (
        <div style={{
          position: 'fixed',
          top: 0, left: 0, right: 0, bottom: 0,
          backgroundColor: 'rgba(0,0,0,0.5)',
          display: 'flex', justifyContent: 'center', alignItems: 'center'
        }}>
          <div style={{
            background: 'white',
            padding: '20px',
            borderRadius: '8px',
            width: '90%',
            maxWidth: '500px',
            maxHeight: '80%',
            overflowY: 'auto'
          }}>
            <h3>Your Submitted Applications</h3>
            {submittedApps.length === 0 ? (
              <p>No applications found.</p>
            ) : (
              submittedApps.map((app, idx) => (
                <div key={idx} style={{
                  padding: '10px',
                  borderBottom: '1px solid #ccc'
                }}>
                  <p><strong>{app.name}</strong></p>
                  <p>ID: {app.applicationId}</p>
                  <p>Status: <strong>{app.status}</strong></p>
                </div>
              ))
            )}
            <div style={{ textAlign: 'right', marginTop: '10px' }}>
              <button onClick={closeModal} style={{
                padding: '8px 16px',
                backgroundColor: '#888',
                color: 'white',
                border: 'none',
                borderRadius: '4px'
              }}>
                Close
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Dashboard;
